import { getTransformers, setTransformers } from "./shared.js";
export { setTransformers } from "./shared.js";
export async function loadTransformers(onLoad) {
    if (getTransformers() === null) {
        setTransformers(await import("@xenova/transformers"));
    } else {
        return getTransformers();
    }
    const transformer = getTransformers();
    onLoad(transformer);
    return transformer;
}
